css:
atom-text-editor,
:host {
  color: #c5d4dd;
  background-color: #3c4c55;
}
atom-text-editor .gutter,
:host .gutter {
  color: #6a7d89;
  background-color: #3c4c55;
}
atom-text-editor .gutter .line-number,
:host .gutter .line-number {
  opacity: 1;
}
atom-text-editor .gutter .line-number.cursor-line,
:host .gutter .line-number.cursor-line {
  color: #7fc1ca;
  background-color: #3c4c55;
}
atom-text-editor .invisible-character,
:host .invisible-character {
  color: #899ba6;
}
atom-text-editor .indent-guide,
:host .indent-guide {
  color: #556873;
}
atom-text-editor .wrap-guide,
:host .wrap-guide {
  background-color: #556873;
}
atom-text-editor .cursor,
:host .cursor {
  opacity: 0.8 !important;
}
atom-text-editor .lines .line.cursor-line,
:host .lines .line.cursor-line {
  background-color: #556873;
}
atom-text-editor .selection .region,
:host .selection .region {
  background-color: #7fc1ca;
  opacity: 0.5;
}
atom-text-editor .bracket-matcher .region,
:host .bracket-matcher .region {
  border: none;
  outline: 1px dotted #7fc1ca;
}
atom-text-editor .spell-check-misspelling .region,
:host .spell-check-misspelling .region {
  border: none;
  outline: 1px dotted #df8c8c;
}
atom-text-editor .fold-marker:after,
:host .fold-marker:after,
atom-text-editor .gutter .line-number.folded,
:host .gutter .line-number.folded {
  color: #7fc1ca;
}
atom-text-editor .bracket-matcher .region,
:host .bracket-matcher .region {
  border-color: #7fc1ca;
}
atom-text-editor .scrollbars-visible-always /deep/ ::-webkit-scrollbar,
:host .scrollbars-visible-always /deep/ ::-webkit-scrollbar {
  width: 8px;
  height: 8px;
}
atom-text-editor .scrollbars-visible-always /deep/ ::-webkit-scrollbar-track,
:host .scrollbars-visible-always /deep/ ::-webkit-scrollbar-track,
atom-text-editor .scrollbars-visible-always /deep/ ::-webkit-scrollbar-corner,
:host .scrollbars-visible-always /deep/ ::-webkit-scrollbar-corner {
  background: #6a7d89;
}
atom-text-editor .scrollbars-visible-always /deep/ ::-webkit-scrollbar-thumb,
:host .scrollbars-visible-always /deep/ ::-webkit-scrollbar-thumb,
atom-text-editor .scrollbars-visible-always /deep/ ::-webkit-scrollbar-thumb:hover,
:host .scrollbars-visible-always /deep/ ::-webkit-scrollbar-thumb:hover {
  background: #7fc1ca;
  border-radius: 5px;
  box-shadow: 0;
}
.jsx.attribute-name {
  font-style: normal !important;
}
.constant,
.numeric,
.boolean,
.string.quoted,
.punctuation.string,
.variable.property,
.variable.other,
.dictionary.value,
.css.property-value,
.markup.link,
.markup.raw,
.html.id {
  color: #7fc1ca;
}
.variable.entity,
.function.entity,
.object.key,
.variable.shorthandpropertyname,
.entity.class,
.css.attribute-name,
.css.tag,
.jsx.attribute-name,
.html.tag {
  color: #83afe5;
}
.control,
.operator,
.punctuation.operator,
.css.property-name,
.jsx.component,
.jsx.tag,
.html.attribute-name {
  color: #dada93;
}
.storage,
.undefined,
.null,
.nan {
  color: #a8ce93;
}
.module,
.dom,
.this,
.builtin,
.process {
  color: #9a93e1;
}
.css.pseudo-class,
.markup.italic,
.markup.bold {
  color: #d18ec2;
}
.arrow,
.brace.square,
.brace.curly,
.brace.round,
.punctuation.parameters,
.quasi.begin,
.quasi.end,
.dictionary.begin,
.dictionary.end,
.module.all,
.css.property-list,
.css.function,
.markup.heading,
.list,
.jsx.embedded {
  color: #f2c38f;
}
.comment,
.meta,
.punctuation {
  color: #899ba6;
}
